description:
Hammer Head

Science Documentary hosted by Daniel Browning Smith, published by History Channel broadcasted as part of HC Stan Lees Superhumans series in 2010 - English narration


Information
------------------------------

Daniel meets Dean Karnazes of San Francisco, who can ignore extreme fatigue and ran 50 marathons in 50 states in 50 days; John Ferraro of Boston, whose thick skull can withstand the blow of a sledgehammer; Chris Robinson of Edinburgh, Scotland who believes his dreams can predict the future; and Kenny Muhammad of New York City, &quot;The Human Orchestra&quot;, who can mimic complex beatbox rhythms with his mouth.

